import React from 'react';
import { StyleSheet, Button, View, SafeAreaView, Text, Separator } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Calendario from './Calendar'
import Mapa from './Map'
import HomeScreen from './Home';

const RootStack = createStackNavigator();

const App = () => {
  return (
    <ImageBackground source={require('./assets/background.png')} style={{width: '100%', height: '100%'}}>
      <NavigationContainer>
        <RootStack.Navigator>
          <RootStack.Screen name="Home" options={{ title: ' ' , headerTintColor: '#ea6227'}}  component={HomeScreen} />
          <RootStack.Screen name="Calendar" options={{ title: ' ' , headerTintColor: '#ea6227'}} component={Calendario} />
          <RootStack.Screen name="Map" options={{ title: ' ' , headerTintColor: '#ea6227'}} component={Mapa} />
        </RootStack.Navigator>
      </NavigationContainer>
    </ImageBackground>

  );
};

export default App;

